import React from 'react';
const work = (props) => {
    const {
        title,
        imageUrl,
        projectDescription,
        projectUrl,
    } = props.workDetail;
    console.log(title, imageUrl, projectDescription, projectUrl);
    return <div>{(title, imageUrl, projectDescription, projectUrl)}</div>;
};

export default work;
// { title, imageUrl, projectDescription, projectUrl }
